088856582", "lang": "de"}, {"author_id": "38001527", "reply_settings": "everyone", "created_at": "2020-10-26T07:14:23.000Z", "possibly_sensitive": false, "entities": {"mentions": [{"start": 105, "end": 114, "username": "cducsubt", "id": "46085533"}]}, "text": "Die Nachricht vom Tod des Bundestagsvizepr\u00e4sidenten Thomas Oppermann macht mich fassungslos. Die gesamte @cducsubt trauert um einen leidenschaftlichen und k\u00e4mpferischen Demokraten. Unsere Gedanken sind in diesen schweren Stunden bei seiner Familie.", "source": "Twitter for iPhone", "public_metrics": {"retweet_count": 27, "reply_count": 3, "like_count": 320, "quote_count": 4}, "id": "1320624801636110336", "conversation_id": "1320624801636110336", "lang": "de"}, {"author_id": "17960911", "reply_settings": "everyone", "entities": {"hashtags": [{"start": 36, "end": 44, "tag": "Dresden"}]}, "created_at": "2020-10-22T16:09:39.000Z", "possibly_sensitive": false, "text": "Nach der t\u00f6dlichen Messerattacke in #Dresden m\u00fcssen wir versuchen, k\u00fcnftig Gef\u00e4hrder und schwere Straft\u00e4ter auch nach Syrien und andere kritische Regionen abzuschieben. Der Schutz der B\u00fcrger muss im Vordergrund stehen, nicht der T\u00e4terschutz!", "source": "Twitter for iPhone", "public_metrics": {"retweet_count": 57, "reply_count": 54, "like_count": 449, "quote_count": 4}, "id": "1319309955242070016", "geo": {"place_id": "3078869807f9dd36"}, "conversation_id": "1319309955242070016", "lang": "de"}, {"author_id": "773247224", "reply_settings": "everyone", "entities": {"hashtags": [{"start": 78, "end": 88, "tag": "Forschung"}], "mentions": [{"start": 219, "end": 231, "username": "NomosVerlag", "id": "20437221"}], "urls": [{"start": 256, "end": 279, "url": "https://t.co/s5T1UEuwmq", "expanded_url": "https://www.apb-tutzing.de/news/2020-09-23/die-sprache-von-forschung-und-lehre", "display_url": "apb-tutzing.de/news/2020-09-2\u2026"}, {"start": 280, "end": 303, "url": "https://t.co/zo3nHspu48", "expanded_url": "https://twitter.com/APBTutzing/status/1309028045852942337/photo/1", "display_url": "pic.twitter.com/zo3nHspu48"}]}, "created_at": "2020-09-24T07:13:01.000Z", "possibly_sensitive": false, "attachments": {"media_keys": ["3_1309017177874477056"]}, "text": "Im Landtag formiert sich eine Bewegung, die Deutsch an Unis erhalten will, um #Forschung weiterhin einer breiten \u00d6ffentlichkeit zug\u00e4nglich zu machen. Daf\u00fcr spricht sich auch unsere neuste Publikation aus. Erh\u00e4ltlich im @NomosVerlag und an der Akademie. \n\u25b6\ufe0fhttps://t.co/s5T1UEuwmq https://t.co/zo3nHspu48", "source": "Twitter Web App", "public_metrics": {"retweet_count": 4, "reply_count": 0, "like_count": 5, "quote_count": 0}, "id": "1309028045852942337", "conversation_id": "1309028045852942337", "lang": "de"}, {"author_id": "47620601", "reply_settings": "everyone", "created_at": "2020-07-26T14:46:48.000Z", "possibly_sensitive": false, "entities": {"mentions": [{"start": 71, "end": 75, "username": "CDU", "id": "20429858"}]}, "text": "Unser Land verliert einen gro\u00dfen und engagierten Sozialdemokraten. Die @cdu nimmt Abschied von Hans-Jochen Vogel - einer gro\u00dfen Pers\u00f6nlichkeit, die \u00fcber alle Parteigrenzen hinweg gesch\u00e4tzt wurde. Mein tief empfundenes Mitgef\u00fchl gilt seiner Frau, seinem Bruder und den Angeh\u00f6rigen.", "source": "Twitter for iPhone", "public_metrics": {"retweet_count": 55, "reply_count": 22, "like_count": 424, "quote_count": 3}, "id": "1287398971703517184", "conversation_id": "1287398971703517184", "lang": "de"}, {"author_id": "50986099", "reply_settings": "everyone", "entities": {"hashtags": [{"start": 58, "end": 65, "tag": "Gruene"}, {"start": 71, "end": 75, "tag": "spd"}, {"start": 96, "end": 100, "tag": "CSU"}, {"start": 133, "end": 137, "tag": "CSU"}, {"start": 268, "end": 275, "tag": "Frauen"}], "mentions": [{"start": 9, "end": 25, "username": "JohannesSingham", "id": "542415865"}], "urls": [{"start": 277, "end": 300, "url": "https://t.co/OXr9r3pze3", "expanded_url": "https://twitter.com/JohannesSingham/status/1277526145282584576", "display_url": "twitter.com/JohannesSingha\u2026"}]}, "created_at": "2020-06-29T09:12:06.000Z", "possibly_sensitive": false, "text": "Verstehe @JohannesSingham nicht. Wer heute per Erststimme #Gruene oder #spd w\u00e4hlt, bekommt auch #CSU, selbst wenn mehr Stimmen nicht #CSU w\u00e4hlen. Doch doch, das gibt's. Und ist auch Demokratie, aber mitnichten bedeutungslos. Und: es w\u00e4hlen &amp; kandidieren dort auch #Frauen! https://t.co/OXr9r3pze3", "source": "Twitter for Android", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 0, "quote_count": 0}, "id": "1277530271647219712", "conversation_id": "1277530271647219712", "lang": "de", "referenced_tweets": [{"type": "quoted", "id": "1277526145282584576"}]}, {"author_id": "17960911", "reply_settings": "everyone", "entities": {"hashtags": [{"start": 43, "end": 53, "tag": "Stuttgart"}]}, "created_at": "2020-06-21T17:28:51.000Z", "possibly_sensitive": false, "text": "Wenn ich mir die Berichterstattung rund um #Stuttgart ansehe, frage ich mich, ob Medien und Beh\u00f6rden nichts aus der K\u00f6lner Silvesternacht gelernt haben. Was soll die \u201eParty- und Eventszene\u201c sein? Hier m\u00fcssen T\u00e4ter beim Namen genannt werden.", "source": "Twitter for iPhone", "public_metrics": {"retweet_count": 524, "reply_count": 207, "like_count": 2898, "quote_count": 43}, "id": "1274756178879209472", "conversation_id": "1274756178879209472", "lang": "de"}, {"author_id": "253780525", "reply_settings": "everyone", "created_at": "2020-06-06T11:23:42.000Z", "possibly_sensitive": false, "entities": {"mentions": [{"start": 0, "end": 16, "username": "JohannesSingham", "id": "542415865"}]}, "text": "@JohannesSingham Sie schreiben Freiheit und Frieden, meinen aber die Vereidigungsausgaben.", "source": "Twitter Web App", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 1, "quote_count": 1}, "in_reply_to_user_id": "542415865", "id": "1269228466689527811", "conversation_id": "1269227065687056384", "lang": "de", "referenced_tweets": [{"type": "replied_to", "id": "1269227065687056384"}]}, {"author_id": "747696132495650816", "reply_settings": "everyone", "created_at": "2020-05-13T10:02:48.000Z", "possibly_sensitive": false, "attachments": {"media_keys": ["3_1260510594127536128"]}, "text": "Das Urteil des Bundesverfassungsgerichts zu den EZB-Anleihek\u00e4ufen ist ein wichtiges Warnsignal an die EU-Institutionen, die europ\u00e4ischen Vertr\u00e4ge einzuhalten und die Grenzen ihrer Kompetenzen zu wahren. https://t.co/Tx290rqkRI", "source": "Twitter Web App", "entities": {"urls": [{"start": 203, "end": 226, "url": "https://t.co/Tx290rqkRI", "expanded_url": "https://twitter.com/csu_bt/status/1260510800260800512/photo/1", "display_url": "pic.twitter.com/Tx290rqkRI"}]}, "public_metrics": {"retweet_count": 4, "reply_count": 5, "like_count": 35, "quote_count": 1}, "id": "1260510800260800512", "conversation_id": "1260510800260800512", "lang": "de"}, {"author_id": "2192588903", "reply_settings": "everyone", "entities": {"hashtags": [{"start": 16, "end": 23, "tag": "Israel"}, {"start": 88, "end": 95, "tag": "Strau\u00df"}, {"start": 185, "end": 191, "tag": "Shoah"}, {"start": 270, "end": 277, "tag": "IL55DE"}], "mentions": [{"start": 260, "end": 269, "username": "cducsubt", "id": "46085533"}]}, "created_at": "2020-05-12T14:11:42.000Z", "possibly_sensitive": false, "text": "Deutschland und #Israel feiern 55 Jahre diplomatische Beziehungen. Schon davor hatte FJ #Strau\u00df als Verteidigungsminister Israel stark unterst\u00fctzt. Die enge \ud83c\udde9\ud83c\uddea-\ud83c\uddee\ud83c\uddf1 Freundschaft nach der #Shoah ist keine Selbstverst\u00e4ndlichkeit, sondern Geschenk + Verpflichtung. @cducsubt #IL55DE", "source": "Twitter for Android", "public_metrics": {"retweet_count": 21, "reply_count": 8, "like_count": 111, "quote_count": 2}, "id": "1260211049090949120", "geo": {"place_id": "3