: "26458162"}, {"start": 267, "end": 279, "username": "MarkusBlume", "id": "855232346"}], "hashtags": [{"start": 227, "end": 234, "tag": "Bremen"}], "urls": [{"start": 281, "end": 304, "url": "https://t.co/HrocUMH0sl", "expanded_url": "https://twitter.com/CSU/status/1155123124461084673/photo/1", "display_url": "pic.twitter.com/HrocUMH0sl"}]}, "conversation_id": "1155123124461084673", "public_metrics": {"retweet_count": 78, "reply_count": 279, "like_count": 316, "quote_count": 83}, "reply_settings": "everyone", "created_at": "2019-07-27T14:29:48.000Z", "text": "\u201eDie Vorschl\u00e4ge der @dieLinke, die Fluglinien zu verstaatlichen, sind gruselig. DDR 2.0. Als N\u00e4chstes wieder Ausreiseverbote f\u00fcr alle? @Die_Gruenen und @spdde m\u00fcssen sich von dieser Partei distanzieren, statt gemeinsame Sache (#Bremen) zu machen\u201c, so Generalsekret\u00e4r @MarkusBlume. https://t.co/HrocUMH0sl", "source": "Twitter Web App", "attachments": {"media_keys": ["3_1155123105079148544"]}, "id": "1155123124461084673", "lang": "de"}, {"author_id": "17960911", "possibly_sensitive": false, "conversation_id": "1143204032107995138", "public_metrics": {"retweet_count": 24, "reply_count": 4, "like_count": 134, "quote_count": 1}, "reply_settings": "everyone", "created_at": "2019-06-24T17:07:35.000Z", "text": "Ich bin tief best\u00fcrzt, dass heute ein Soldat unserer Bundeswehr in der Aus\u00fcbung seines Dienstes sein Leben verloren hat. Mein tiefes Mitgef\u00fchlt gilt seiner Familie und seinen Freunden. Der Beruf des Soldaten ist kein Beruf wie jeder andere, unsere Soldaten verdienen unseren Dank.", "source": "Twitter for iPhone", "id": "1143204032107995138", "lang": "de"}, {"author_id": "747696132495650816", "possibly_sensitive": false, "conversation_id": "1124924440016326658", "public_metrics": {"retweet_count": 8, "reply_count": 2, "like_count": 41, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2019-05-05T06:31:01.000Z", "text": "Wir feiern heute #Patronatstag