d_at": "2019-04-01T08:04:51.000Z", "text": "Wir sind uns einig: Wir brauchen Verbesserungen bei der #Organspende. Wir sollten aber die Organspende nach dem Tod als eine bewusste und freiwillige Entscheidung beibehalten. #Entscheidungsl\u00f6sung", "source": "Twitter for iPhone", "entities": {"hashtags": [{"start": 56, "end": 68, "tag": "Organspende"}, {"start": 176, "end": 196, "tag": "Entscheidungsl\u00f6sung"}]}, "id": "1112626865871769601", "lang": "de"}, {"author_id": "747696132495650816", "possibly_sensitive": false, "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1016738021939351558", "name": "North Atlantic Treaty Organization", "description": "North Atlantic Treaty Organization"}}], "conversation_id": "1096426478412140544", "public_metrics": {"retweet_count": 38, "reply_count": 155, "like_count": 220, "quote_count": 37}, "reply_settings": "everyone", "created_at": "2019-02-15T15:10:17.000Z", "text": "Wir wollen eine starke Bundeswehr - mit bester Ausr\u00fcstung und modernstem Ger\u00e4t. Deshalb bekennen wir uns klar zu mehr Investitionen in die Verteidigung und zum 2%-Ziel der NATO. Bis zum Ende der n\u00e4chsten Wahlperiode m\u00fcssen 60 Mrd. Euro f\u00fcr die Verteidigung bereitstehen! #MSC2019 https://t.co/gs4ZNmsHkW", "source": "Twitter Web Client", "attachments": {"media_keys": ["3_1096426058059005956"]}, "entities": {"hashtags": [{"start": 271, "end": 279, "tag": "MSC2019"}], "urls": [{"start": 280, "end": 303, "url": "https://t.co/gs4ZNmsHkW", "expanded_url": "https://twitter.com/csu_bt/status/1096426478412140544/photo/1", "display_url": "pic.twitter.com/gs4ZNmsHkW"}]}, "id": "1096426478412140544", "lang": "de"}, {"author_id": "17960911", "possibly_sensitive": false, "conversation_id": "1077866251211468800", "public_metrics": {"retweet_count": 19, "reply_count": 7, "like_count": 51, "quote_count": 0}, "reply_settings": "everyone", "creat